const puppeteer = require("puppeteer");

async function generatePdf(htmlContent, isHaveTable) {
  const browser = await puppeteer.launch({
    headless: true, // Run in headless mode (no UI)
    args: ["--no-sandbox", "--disable-setuid-sandbox"], // For server environments
  });
  const page = await browser.newPage();

  // Set the HTML content
  await page.setContent(htmlContent);
  await page.emula;
  await page.emulateMediaType("screen"); // Set media type to screen
  // Generate PDF
  const pdfBuffer = await page.pdf({
    format: "A4", // Page size
    printBackground: true,
    displayHeaderFooter: true,
    landscape: isHaveTable ? true : false,

    headerTemplate: `
      <div style="font-size: 10px; text-align: center; width: 100%; padding: 10px; display: flex; justify-content:space-between; align-items: center;padding-left:40px;padding-right:40px;">
      <span><img
      width="100px" src="data:image/png;base64," alt="Hududgaz logo"/></span>
      <span>Hududgaz Farg'ona | fergana-hududgaz</span>
      <span><img width="100px" src="data:image/svg+xml;base64," alt="Premiumsoft logo"/></span>
      </div>
    `,
    footerTemplate: `
      <div style="font-size: 10px; text-align: center; width: 100%; padding: 10px; display:flex; justify-content:space-between; padding-left:40px;padding-right:40px;">
        <span>https://farhududgaz.uz</span>
        <span><span class="pageNumber"></span>/<span class="totalPages"></span></span>
      </div>
    `,
    margin: {
      top: "20mm",
      right: "10mm",
      bottom: "20mm",
      left: "10mm",
    },
    headerHeight: "20mm", // Height of the header
    footerHeight: "20mm",
  });

  await browser.close();

  return pdfBuffer;
}

module.exports = generatePdf;
